import React, {Component} from "react";
import TopNavBar from "./TopNavBar";
import Divider from "antd/es/divider";
import Button from "antd/es/button";
import { Rate } from 'antd';
import PageHeader from "antd/es/page-header";

class ProjectDetailComponent extends Component{
    constructor(props) {
        super(props);
        this.state = {
            id: this.props.match.params.id,
            description: ''
        }
        console.log(this.state.id)
    }

    render() {
        return (
            <div>
                <TopNavBar />
                <div className="project-container">
                    <div className="project-title">
                        <PageHeader
                            className="site-page-header"
                            onBack={() => window.history.back()}
                            title="project name"
                            subTitle="This is a subtitle"
                        />

                    </div>
                    <div className="project-detail">
                        <div className="project-detail-head">
                            <div className="project-detail-head-wrapper" >
                                <div className="project-detail-head-title">
                                    <img src="https://assets.laioffer.com/public/companyLogo/9b7556fe-3187-4f58-b290-b9a1348db9a3.png" height="120px" width="120px" className="project-img"/>
                                    <div className="project-title-right">
                                        <h2>Project name</h2>
                                        <span>company name</span><br/>
                                        <span>time</span><br/>
                                        <Rate disabled defaultValue={4.9} />
                                    </div>
                                </div>
                                <div className="project-apply">
                                    <Button type="primary" shape="round" size="large">
                                        Apply
                                    </Button>
                                </div>
                                <div className="project-clear"></div>
                            </div>
                        </div>

                        <div className="project-detail-body">
                            <Divider />
                            <div className="project-detail-content">
                                <h4>Project description</h4>
                                Learn Python like a Professional! Start from the basics and go all the way to creating your own applications and games!<br/>
                                <Button type="primary" shape="round" size="large" className='button-detail'> Detail</Button>
                            </div>
                        </div>

                    </div>

                </div>
            </div>
        )
    }
}

export default ProjectDetailComponent;
